CREATE TABLE city(
   city       VARCHAR(250)
  ,city_ascii VARCHAR(250)
  ,lat        DOUBLE
  ,lng        DOUBLE
  ,country    VARCHAR(250)
  ,iso2       VARCHAR(250)
  ,iso3       VARCHAR(250)
  ,admin_name VARCHAR(250)
  ,capital    VARCHAR(250)
  ,population INT 
  ,id         BIGINT AUTO_INCREMENT NOT NULL
);

